import React, { Component } from "react";
import { Tabs, Tab, Typography, Box } from "@material-ui/core";
import Login from "./Login";
import Register from "./Register";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`wrapped-tabpanel-${index}`}
      aria-labelledby={`wrapped-tab-${index}`}
      {...other}
    >
      <Box p={3}>{children}</Box>
    </Typography>
  );
}

export default class LoginOrRegister extends Component {
  state = {
    value: "zero"
  };

  render() {
    return (
      <div
        style={{
          backgroundImage:
            "https://st3.depositphotos.com/8571010/15482/i/1600/depositphotos_154822178-stock-photo-close-up-of-sports-shoes.jpg"
        }}
      >
        <Tabs
          style={{
            color: "blue",
            marginTop: 20,
            marginLeft: 200
          }}
          value={this.state.value}
          onChange={(event, newValue) => {
            this.setState({ value: newValue });
            console.log(newValue);
          }}
        >
          <Tab value="zero" label="LOGIN"></Tab>
          <Tab value="one" label="REGISTER"></Tab>
        </Tabs>
        <TabPanel value={this.state.value} index="zero">
          <Login />
        </TabPanel>
        <TabPanel value={this.state.value} index="one">
          <Register />
        </TabPanel>
      </div>
    );
  }
}
